import botao from './nav.module.css';


export default function Menuh(){
    
    return(
        <div className={botao.bot_h}>
            <svg height="45" width="45" id="bot">
            <path d="M 160 220 l 55 0"  stroke="white" stroke-width="3" fill="none" />
            <path d="M 175 240 l 40 0" stroke="white" stroke-width="3" fill="none" />
            <path d="M 190 260 l 25 0" stroke="white" stroke-width="3" fill="none" />
            </svg>
        </div>
    )
}
